// lib
import React from "react";
import { createUseStyles } from "react-jss";
import { BrowserRouter, Routes, Route, Link } from "react-router-dom";
import { useState, useEffect } from "react";

// Component
import Home from "./components/home/Home";
import SignIn from "./components/users/signIn/SignIn";
import SignUp from "./components/users/signIn/SignIn";

// Css
import "./screenSaver.modul.css";

function ScreenSaver({user}) {
  return (
    <div className="ScreenSaver">
      <Header user={user} />

      <div className="content">
        <h1 className="title">Todo App</h1>
        <p className="desc">
          Keep track of the daily tasks in life and get that satisfaction upon
          copletion.
        </p>
        <div className="screenSaver__buttons btns--flex">
          <Link to="users/signIn">
            <button className="screenSaver__button button btn--none-border btn--bg-pink btn--bb-pink">
              get start
            </button>
          </Link>
          <Link to="">
            <button className="screenSaver__button button btn--none-border btn--bg-gray btn--bb-gray">
              learn more
            </button>
          </Link>
        </div>
      </div>

      <Routes>
        <Route exact path="/users/signIn" element={<SignIn />} />
        <Route exact path="/users/signUp" element={<SignUp />} />
      </Routes>
    </div>
  );
}
export default ScreenSaver;
